import React from 'react';
//import LogoInicio from '../public/LogoInicio.jpg';
import { NavLink } from 'react-router-dom';
//<img src={LogoInicio} alt="LogoDL" />
const Inicio = () => {
    return (
        <div className="card">
                <nav >
                    <table className="cardbody" >                    
                        <NavLink  exact to="/Timeline"  id="dash" >TimeLine</NavLink>
                    </table>
                </nav>
        </div>
    )
}

export default Inicio
